  &:hover {
    background: #ebebeb;
  }
  @media (max-width: 900px) {
    /* background-color: red; */
    width: 100%;
    padding: 10px 3px 10px 3px;
  }
`;

const ProductName = styled.span`
  font-weight: 500;
  color: #333;
`;

const ProductDetails = styled.span`
  font-size: 14px;
